import {
	//SideBarMenuTitle,
	SideBarMenuButton,
	SideBarMenuName,
} from './SideBarMenuButtonStyles.elements';

import React from 'react';
import { categories } from '../../../containers/StreamsList/mockedData';

const SideBarMenuItem = () => {
	return categories.map((category, key) => (
		<SideBarMenuButton key={key} to=''>
			<SideBarMenuName>{category}</SideBarMenuName>
		</SideBarMenuButton>
	));
};

export default SideBarMenuItem;
